import { useState } from "react";

export function Navbar() {
        return (
            <div className="sidebar">
                <ul>
                    <li><a href="/">Home</a></li>
                    <li><a href="/about">About</a></li>
                    <li><a href="/contact">Contact</a></li>
                </ul>
            </div>
        );
}
